export const UseStyles = makeStyles((theme) => ({
    card: {
        background: "#171a2b !important",
        borderBottomRightRadius: 40,
        width:"300px",
        height:"200px",
        margin: 23,
    },
    cardHeader: {
        background: "#171a2b !important",
    }
}))
